Sprzedam Peugeot 307 SW kombi 

Przebieg 267 tyś.

Przegląd do 02.2026

OC - 08.2025

Auto sprawne, niezawodne, służy do dziś, pali od "pierwszego" za każdym razem (w zimie również). Silnik "nie do zajechania".

Z tego co pamiętam wymieniałem:

- rozrusznik;

- akumulator;

- chłodnica;

- rozrząd, paski;

- oleje.

Ostatnio wymieniałem: 

- tłumik końcowy;

- tarcze hamulcowe tył;

- klocki tył.

Niesprawne:

- spryskiwacz;

- klapa bagażnika raz zamyka elektrozamek raz nie;

- maska silnika otwierana sposobem;

- prawa szyba elektryczna - nie opuszczam bo może się nie podnieść;

- słychać łącznik z prawej strony;

- auto otwierane z kluczyka- nie z pilota.

Dorzucam opony zimowe na metalowych felgach.

Dzień dobry,



mam do sprzedania samochód VW GOLF V 1.9TDI z 2007 roku.



Auto serwisowane (od roku prowadzę też książkę serwisową wraz z paragonami za wykonane usługi)

- OC ważne do grudnia br.;

- przegląd ważny do lutego 2026 roku;

- olej i filtry wymieniane przy 232 tys. km. aktualnie ma na przebiegu 238 tys. ale minął już rok od wymiany więc docelowo trzeba będzie niedługo myśleć o wymianie oleju;

- obsługa klimatyzacji wraz z nabiciem i ozonowaniem robiona w maju ubiegłego roku;

- rozrząd robiony w maju ubiegłego roku;

- regeneracja turbiny robiona również ubiegłego roku;

- klocki i tarcze wymienione w czerwcu br.



To z najważniejszych spraw - auto w pełni sprawne, sprzedaję z powodu kupna innego większego samochodu.



Gratis dorzucam gumowy wkład do bagażnika, oraz zapasowy awaryjny kluczyk do  otwarcia auta (lubi się samo zamknąć więc dorobiłem w razie ,,W").



Auto zatankowanej jest do ponad połowy baku.



Stan wizualny auta jak na zdjęciach, posiada liczne zarysowania i odklejającą się z sufitu tapicerkę podpiętą na szpilki oraz mały odprysk na szybie (po uderzeniu małego kamyczka).
